import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as d,e as r}from"./app-b68ace64.js";const h={},c=r('<h3 id="支持的qq版本" tabindex="-1"><a class="header-anchor" href="#支持的qq版本" aria-hidden="true">#</a> 支持的QQ版本</h3><ul><li>版本 <code>8.9.68</code>，<code>8.9.70</code>，<code>8.9.73</code>，<code>8.9.75</code>，<code>8.9.78</code>，<code>8.9.80</code>，<code>8.9.81</code>，<code>8.9.83</code></li><li>未在上述说明中列出的版本可能存在兼容问题。</li></ul><h3 id="某些事件-消息-操作不支持" tabindex="-1"><a class="header-anchor" href="#某些事件-消息-操作不支持" aria-hidden="true">#</a> 某些事件/消息/操作不支持？</h3><p>提交issue，我们会实现。</p><h3 id="qq闪退-每隔一段时间-怎么办" tabindex="-1"><a class="header-anchor" href="#qq闪退-每隔一段时间-怎么办" aria-hidden="true">#</a> QQ闪退(每隔一段时间)怎么办？</h3><p>勾选Shamrock的自动唤醒，或者使用某些框架自带QQ死亡自动唤醒的XP, MAGISK...插件。</p><h3 id="真机息屏状态-api会变慢-无响应" tabindex="-1"><a class="header-anchor" href="#真机息屏状态-api会变慢-无响应" aria-hidden="true">#</a> 真机息屏状态，API会变慢/无响应？</h3><p>使用某些息屏挂机软件，为QQ附加一个息屏挂机状态。</p><h3 id="模拟器部署-qq闪退" tabindex="-1"><a class="header-anchor" href="#模拟器部署-qq闪退" aria-hidden="true">#</a> 模拟器部署，QQ闪退？</h3><p>QQ修复了登录超时的问题，常见模拟器安卓版本(9.0,12.0)均可正常登录，去QQ官网下载最新版本即可。</p><blockquote><p>其次，模拟器部署请使用Shamrock的ALL版本，不要使用WSA(Windows安卓子系统)部署(有兼容问题)。</p></blockquote><h3 id="模拟器部署-外部无法访问接口" tabindex="-1"><a class="header-anchor" href="#模拟器部署-外部无法访问接口" aria-hidden="true">#</a> 模拟器部署，外部无法访问接口？</h3><p>使用<code>adb forward</code>进行转发，把模拟器内的连接转发到外面。</p><h3 id="docker部署支持" tabindex="-1"><a class="header-anchor" href="#docker部署支持" aria-hidden="true">#</a> Docker部署支持？</h3><p>目前依旧在计划中，主要是不太会docker。</p><h3 id="作为签名服务器时-无缝支持其它框架吗" tabindex="-1"><a class="header-anchor" href="#作为签名服务器时-无缝支持其它框架吗" aria-hidden="true">#</a> 作为签名服务器时，无缝支持其它框架吗？</h3><p>支持的，目前已支持的框架是icqq和gocq。</p><h3 id="一定要保证shamrock主app在后台运行吗" tabindex="-1"><a class="header-anchor" href="#一定要保证shamrock主app在后台运行吗" aria-hidden="true">#</a> 一定要保证Shamrock主APP在后台运行吗？</h3><p>不需要，因为OneBot服务运行在QQ主进程中，无需Shamrock主进程运行(当然第一次使用Shamrock，请启动Shamrock，推送配置要求Shamrock和QQ都在运行)。</p><h3 id="云手机支持哪些" tabindex="-1"><a class="header-anchor" href="#云手机支持哪些" aria-hidden="true">#</a> 云手机支持哪些？</h3><p>目前允许在中国移动云手机(Magisk)和红手指云手机(Lspatch)使用Shamrock，其它平台未测试。</p>',21),o=[c];function i(n,t){return e(),d("div",null,o)}const l=a(h,[["render",i],["__file","faq.html.vue"]]);export{l as default};
